description:
365 catalogue records including material that has been collected from Local, State and Federal elections related to South Australian candidates. Also includes State and Federal referendums;
    Local elections 1879 – 2010;
    State elections 1893 – 2014;
    Federal elections 1901 – 2010;
    Referendums 1911 – 1999;
    State referendums 1965, 1970, 1982.
Includes details of candidates, electorates, dates of elections, slogans.
Ephemera are everyday items such as theatre posters and advertising flyers, not produced for sale. Their intrinsic value is in the information they provide about social life, the development of industries (for example, printing or paper making), and the provision of services or aspects of cultural change. Ephemera may be the only printed record of an organisation, event or activity.

The State’s taxation revenue is forecast by a process that involves:  

application of the Department of Treasury and Finance’s economic forecasts, where there is a relationship between taxation revenue and economic variables; and
use of forward indicators, unpublished revenue data and qualitative information from liaison with relevant stakeholders. 

This enables an assessment of economic and other factors influencing the tax
bases from which taxes are sourced e.g. for payroll tax, an assessment of the
outlook for employment.  
Where necessary, adjustment factors are used to account for other trends or
events not captured by the model, such as impact of economic shocks or policy
stimulus.  
The download contains the eight taxation data series:  

total taxation revenue;
payroll tax;
land tax;
land transfer duty;
gambling taxes;
insurance taxes;
motor vehicle taxes; and
other taxes.
